  );
};

export default Sidebar;

const Wrapper = styled.section`
  display: flex;
  flex-direction: column;
  margin-top: 20px;
  max-width: 350px;
  height: 92vh;
  min-height: 640px;
  box-shadow: 5px 10px;
`;
